export type AbstractCar ={ 
    AbstractLight: []
}

export type AbstractLight = {
    id: number
}
export type PremiumLight = AbstractLight &{
    hasDiamonds : boolean,
    color: string
}

export type AbstractEngine = {
    id: number,
    EngineType: string
}
export type HybridEngine = AbstractEngine &{
    hasElectricalEngine : boolean,
    hasNormalEnging: boolean
}

export type SportsEngine = AbstractEngine &{
    hasSportMode : boolean,
}
